/** @format */

import React from "react";
import Navbar from "./Components/Navbar";
import Footer from "./Components/Footer";
import Comman from "./Comman";
import Banner from "./banner1";
const Home = () => {
  return (
    <>
      <Navbar />
      <Comman h1="Grow your business with" src={banner1} />
      <Footer />
    </>
  );
};
export default Home;
